import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


function App() {
  return (

  <Router>
    <div>
      <h1>Prueba</h1>
    </div>
    <Switch>
    <Route path="*/ataque" element={<NoPage />}>


      </Route>

      <Route path="/hola">
        <h1>
          <h1>Casa</h1>
        </h1>

      </Route>
    </Switch>


  </Router>
  );
}

const NoPage = () => {
  return <h1>404</h1>;
};



export default App;
